import React from 'react';
import Button from '../Button';
import style from './styles.scss';

export default class Footer extends React.Component {
  render() {
    return (
      <footer className={style.Footer}>
        <div className={style.imageOverlay} />
        <h2 className={style.title}>Let's Work Together</h2>
        <a className={style.emailLink} href='mailto:mail@willholsten.com'>
          <Button classes='tomato-bg whiteText' text="Let's Talk!" />
        </a>
        <div className={style.connect}>
          <i class='fas fa-github' />
          <i class='fas fa-linkedin' />
        </div>
        <div className={style.copyright}>
          Will Holsten. All Rights Reserved.
        </div>
      </footer>
    );
  }
}
